import { Map, GoogleApiWrapper, Marker } from 'google-maps-react';
import {Component} from 'react';
const mapStyles = {
    width: '100%',
    height: '100%',
  };

export class MapContainer extends Component {
    constructor(props) {
      super(props);

      this.state = {
        stores: [{lat: 47.49855629475769, lng: -122.14184416996333},
                {latitude: 47.359423, longitude: -122.021071},
                {latitude: 47.2052192687988, longitude: -121.988426208496},
                {latitude: 47.6307081, longitude: -122.1434325},
                {latitude: 47.3084488, longitude: -122.2140121},
                {latitude: 47.5524695, longitude: -122.0425407}]
      }
    }

    displayMarkers = () => {
      return this.state.stores.map((store, index) => {
        return <Marker key={index} id={index} position={{
         lat: store.latitude,
         lng: store.longitude
       }}
       onClick={() => console.log("You clicked me!")} />
      })
    }

    render() {
      return (
          <Map
            google={this.props.google}
            zoom={8}
            style={mapStyles}
            initialCenter={{ lat: 47.444, lng: -122.176}}
          >
            {this.displayMarkers()}
          </Map>
      );
    }
  }
  export default GoogleApiWrapper({
    apiKey: 'eyJraWQiOiJnNnJzeVV5OGxHQ1wvdUJmd0ZjYWRicUozbVN1a2tRcXpvNG5JNXV1bndQcz0iLCJhbGciOiJSUzI1NiJ9..imko60o8o_R5GguOldSbsIYXE0IkTIq3Zj5m1KpT90N6J6CYPP2z7erlG0XBZc_-AyrVnDZkv9xwq4ZK7tYkNSMI4hvr7DydeE8740TkocndHBPvvjxxgZG66k3dFHyLeXItwG4VXpiTO8F7I-FoDEr4rydqTGR9qkTNYlL7FrPbJjHgYZhRh6v16DXEKFczoC1reYcC2o8NLJdRocKtPiemtVs9MB-Yum5PwCVDVPA-oR_GJda74UUxjVh3Y2AckIidEiOrfIfPhQiKhdfkZIpFU-avqoKU5lWe-MxKZtN74BMKZdFYFGPJDkXwFisGbB3Jh_mw9jzqf9uuEAkmZQ'
  })(MapContainer);
